import React, {Component} from 'react';

export default class ItemStatusFilter extends Component{


buttons = [
    {name: 'all', label: 'All'},
    {name: 'active', label: 'Active'},
    {name: 'all', label: 'All'}
]



    render() {
        return(



            <div className="btn-group">
                <button
                    type="button"
                        className="btn btn-outline-secondary all"
                        onClick={this.all}
                >
                    All
                </button>


                <button
                    type="button"
                    className="btn btn-outline-secondary act"
                    onClick={this.onlyActive}
                >
                    Active
                </button>


                <button
                    type="button"
                    className="btn btn-outline-secondary done"
                    onClick={this.onlyDone}
                >
                    Done
                </button>


            </div>

        )
    }

}
